La aplicación “Noticias de China” es la propiedad de XINHUANET Co., Ltd y está operada por la misma empresa. 
Siendo la principal plataforma informativa multimedia creada por la Agencia de Noticias Xinhua, Xinhuanet publica noticias globales 24 horas al día. 
Descargue “Noticias de China” ahora mismo y podrá:
- Recibir reportajes y análisis a través de nuestra red mundial;
- Obtener todas las informaciones que usted necesita con respeto a China, el mundo, la economía , entre otros;
-No perder nunca las noticias de última hora mediante suscribirse a Notificaciones Push;
- Ver vídeos y transmisiones en vivo;
- Ver galerías de fotos e imágenes en pantalla completa;
- Personalizar el servicio informativo;
- Compartir artículos a sus redes sociales, o enviarlos por correo electrónico/SMS a sus amigos.
La aplicación mantendrá la seguridad de los datos personales de los usuarios y no se los compartirá con nadie, de acuerdo con su Política de Privacidad.
